import coffee1 from './Images/'

const Home = () => {
    return (
        <>
            <div className="coffee-bg">
                <h2 className="home-h2">
                    Start your Day with a perfect Coffee
                </h2>
           <img src={coffee1} alt="" />
            </div>
        </>
    );
}

export default Home;
